import { Trainers } from "../components/Data"
import NavBar from "../components/NavBar"


const Trainer = (props) => {
    return (
        <div>
            <NavBar active="Team" />
            {
                Trainers.map((trainer) =>
                    trainer.id == props.id &&
                    <div>
                        {trainer.firstName}
                    </div>


                )
            }
        </div>
    )
}

export default Trainer
